import { Dashboard , AboutUsPage, Login,RenderLogin,ModalPage,Contact,LoginPrivatePage, RegisterFormPage} from "./pages/index";
import { BrowserRouter, Routes, Route } from "react-router-dom";


const Router = (props) => {

    return(
        <BrowserRouter>
        <Routes>
        <Route exact path='/dashboard' element={< Dashboard />}/>
        <Route exact path='/About' element={< AboutUsPage passingData={props.aboutUsData}/>}/>
        <Route exact path='/contact' element={<Contact/>}/>
        <Route exact path='/login' element={<Login/>}/>
        <Route exact path='/render' element={<RenderLogin/>}/>
        <Route exact path='/' element={< ModalPage />}/>
        <Route exact path='/loginPrivate' element={< LoginPrivatePage />}/>
        <Route exact path='/register' element={< RegisterFormPage />}/>
        </Routes>
        </BrowserRouter>
    )

}

export default Router;
